import React from 'react';
import { StyledCell } from './styles/StyledCell';
import { TETROMIN }  from '../tetrominos';


const Cell = ({type}) => (
    <StyledCell type={'L'} color={TETROMIONS['L'].color} />
)

export default Cell;
